import { Component } from "react";
const axios = require ('axios');

function Ingresar(){
    var email =document.getElementById('email');
    var pass= document.getElementById('pass'); 

    if (email.value.trim()===''){
        if (pass.value.trim()===''){
            console.log ('Campos obligatorios')
        }
        else{
            axios.post('http://localhost:3200/api/user/login',{
                UsEmail: document.getElementById('email').value,
                UsPass: document.getElementById('pass').value})
        }    
    }  
}

class Ingreso extends Component{

    

    render(){
        return(
            <div>
                <form>
                    Email: <input type='email' className="element" id='email'></input><br/>
                    pass: <input type='password' className="element" id='pass'></input><br/>
                    <button className="element" onClick={Ingresar()}>Ingresar</button>
                </form>
            </div>
        )
    }
}

export default Ingreso;
